import React from 'react';
import './Privacy.css';

class Privacy extends React.Component {
    render() {
        return (
            <div className="Privacy">
                <div className="navbar">
                    <button type="button" id="leftArrow" onClick={() => document.location.reload()}>&larr;</button>
                    <h1>Privacy Policy</h1>
                    <hr style={{padding: "0"}}/>
                </div>
                <div class="col-sm">

